<?php

require 'vendor/autoload.php';

use chillerlan\QRCode\QRCode;

function meus_certificados()
{
    ob_start();

    global $wpdb;

    $current_user = wp_get_current_user();
    $user_id = $current_user->ID;
    $user_name = get_user_meta($user_id, 'first_name', true) . ' ' . get_user_meta($user_id, 'last_name', true);
    $error = 0;
    $link_key = '';
    $mail = '';
    $aluno = '';

    if (isset($_GET['mail'])) {
        $mail = $_GET['mail'];
    }

    if ($mail) {
        $link_key = $mail;
        $aluno_formado = $wpdb->get_results("SELECT * FROM wpre_aptmd_alunos_formados WHERE `key` = '{$link_key}'");
        if (!empty($aluno_formado)) {
            $aluno_formado = $aluno_formado[0];
            if ($aluno_formado->id_formador === $user_id) {
                $error = 1;
            } else {
                $data_fim = $aluno_formado->data_fim;
                $data_inicio = $aluno_formado->data_inicio;
                $name = $aluno_formado->nome_aluno;
                $local = $aluno_formado->local;
                $carga_horaria = $aluno_formado->carga_horaria;
                $ano = explode('-', $data_fim)[0];
                $semester = intval(intval(explode('-', $data_fim)[1]) / 6 + 1);
                $pais = explode('/', $local)[0];
                $cidade = explode('/', $local)[1];
                $local_formacao = explode('/', $local)[2];

                $svg = "<svg width='1123' height='768' xmlns='http://www.w3.org/2000/svg' xmlns:xlink='http://www.w3.org/1999/xlink'>
                    <!-- Created with Method Draw - http://github.com/duopixel/Method-Draw/ -->
                    <g>
                        <title>background</title>
                        <rect fill='#fff' id='canvas_background' height='770' width='1125' y='-1' x='-1' />
                        <g display='none' overflow='visible' y='0' x='0' height='100%' width='100%' id='canvasGrid'>
                            <rect fill='url(#gridpattern)' stroke-width='0' y='0' x='0' height='100%' width='100%' />
                        </g>
                    </g>
                    <g>
                        <title>Layer 1</title>
                        <image x='0.76336'
                            xlink:href='data:image/png;base64,'
                            id='svg_8' height='794' width='1123' y='-10.68588' />
                        <image x='0.76336'
                            xlink:href='data:image/png;base64,'
                            id='form:signature' height='794' width='1123' y='-14.3556' />
                        <text style='cursor: move;' opacity='0.75' xml:space='preserve' text-anchor='start' font-family='sans-serif'
                            font-size='12' id='svg_2' y='556.79789' x='337.45721' stroke-width='0' stroke='#000'
                            fill='#000000'>Lecionado de " . $data_inicio . " a " . $data_fim . " e graduando-se como Terapeuta Multidimensional.</text>
                        <text style='cursor: move;' opacity='0.75' xml:space='preserve' text-anchor='start' font-family='sans-serif'
                            font-size='12' id='svg_3' y='55.27018' x='331.49931' stroke-width='0' stroke='#000'
                            fill='#000000'>" . $ano . ": " . $semester . "</text>
                        <text style='cursor: move;' font-weight='normal' xml:space='preserve' text-anchor='start'
                            font-family='sans-serif' font-size='23' id='svg_4' y='474.01404' x='337.00667' stroke-width='0'
                            stroke='#000' fill='#000000'>" . $name . "</text>
                        <text opacity='0.75' xml:space='preserve' text-anchor='start' font-family='sans-serif' font-size='12'
                            id='svg_5' y='156.66033' x='332.90776' stroke-width='0' stroke='#000' fill='#000000'>Facilitado por: " . $user_name . "</text>
                        <text style='cursor: move;' opacity='0.75' xml:space='preserve' text-anchor='start' font-family='sans-serif'
                            font-size='12' id='svg_6' y='529.96712' x='336.95795' stroke-width='0' stroke='#000'
                            fill='#000000'>Completou um workshop de " . $carga_horaria . "h realizado no " . $local_formacao . ", " . $cidade . ", " . $pais . ".</text>
                        <text xml:space='preserve' text-anchor='start' font-family='sans-serif' font-size='12' id='svg_9'
                            y='713.70367' x='401.36514' stroke-width='0' stroke='#000' fill='#000000'>" . $user_name . "</text>
                        <rect stroke='#ffffff' id='signature' height='100.91727' width='266.97204' y='586.23757' x='346.78842'
                            fill-opacity='null' stroke-opacity='null' stroke-width='1.5' fill='#ffffff' />
                            <image x='950' y='590' width='80' height='80' xlink:href='" . (new QRCode)->render($link_key) . "'>
                        </image>
                    </g>
                </svg>
                ";
                if ($mail) {
                    $file = tempnam(sys_get_temp_dir(), 'svg');
                    file_put_contents($file, $svg);

                    $imagick = new Imagick();
                    $imagick->readImage($file);
                    $imagick->setImageFormat('pdf');
                    $imagick->writeImage('certificado.pdf');

                    $headers = array('Content-Type: text/html; charset=UTF-8');
                    $attachments = array(ABSPATH => 'certificado.pdf');

                    wp_mail($current_user->user_email, 'Certificado de Workshop de Terapia Multidimenssional', 'Certificado de Workshop de Terapia Multidimenssional', $headers, $attachments);
                    unlink($file);
                    echo "<h2>Certificado enviado para seu email</h2>";
                    remove_query_arg('mail');
                }
            }
        }
    }
    $alunos_formados = $wpdb->get_results("SELECT * FROM wpre_aptmd_alunos_formados WHERE id_formador = $user_id");
    if ($link_key) :
?>
        <h1 class="confirmacao">Certificado Enviado Para Seu Email!</h1>
    <?php endif; ?>
    <table class="meus_alunos">
        <thead class="table_header">
            <tr class="header_row">
                <th>Nome Formando</th>
                <th>Email</th>
                <th>Carga Horria</th>
                <th>Data de Incio</th>
                <th>Data de Fim</th>
                <th>Localizao</th>
                <th>Opes</th>
            </tr>
        </thead>
        <tbody class="table_body">
            <?php foreach ($alunos_formados as $aluno) : ?>
                <tr class="body_row">
                    <td><?php echo $aluno->nome_aluno; ?></td>
                    <td><?php echo $aluno->email_aluno; ?></td>
                    <td><?php echo $aluno->carga_horaria; ?></td>
                    <td><?php echo $aluno->data_inicio; ?></td>
                    <td><?php echo $aluno->data_fim; ?></td>
                    <td><?php echo $aluno->local; ?></td>
                    <td>
                        <a class="opcao" href="<?php echo add_query_arg(array("mail" => $aluno->key)) ?>">Enviar Para Teu Email</a>
                    </td>
                </tr>
            <?php endforeach; ?>
        </tbody>
    </table>
    <style>
        h1.confirmacao {
            color: #4992ce;
            font-size: 2.5em;
            text-align: center;
            margin: 2em 0;
        }

        table.meus_alunos {
            width: 100%;
            border-collapse: collapse;
            margin: 2em 0;
        }

        table.meus_alunos thead {
            background-color: #4992ce;
            color: #ffffff;
        }

        table.meus_alunos th,
        table.meus_alunos td {
            padding: 1em;
            border: 1px solid #ccc;
        }

        table.meus_alunos tbody tr:hover {
            background-color: #f2f2f2;
        }

        a.opcao {
            display: block;
            width: 100%;
            text-align: center;
            color: #4992ce;
            text-decoration: none;
        }
    </style>
<?php
    return ob_get_clean();
}
add_shortcode('meus_certificados', 'meus_certificados');
?>